import React from "react";

export const ContactPicker = ({contacts, value, name, onChange}) => {
  return (
    <select
      onChange={onChange}
      value={value}
      name={name}
    >
      <option value="">
        No Contact Selected
      </option>
      {contacts.map}
    </select>
  );
};
